import { Button } from '@mui/base/Button';

function Seat({seatNum, data})
{
    console.log("data for seat ", seatNum, ": " ,data);
    let style = "seat rounded-md";
    style += data.available ? " border-solid border-teal-300 bg-transparent border-2 hover:bg-teal-100" :  " bg-teal-300";
    console.log(style);

    return (
        <Button className={style} disabled={data.available}>{data.seatNum}</Button>
    )
}

export default Seat;
